experiences.detail:
- Thực hiện công tác chấm công, quản lý nghỉ phép,...
- Thực hiện công tác tính tiền lương và các chế độ tiền lương cho CBNV: tiền lương, phụ cấp, thưởng/thưởng kinh doanh, ... - Thực hiện các công việc liên quan đến Thuế TNCN: giảm trừ gia cảnh, khấu trừ thuế TNCN hàng tháng, quyết toán thuế TNCN hàng năm;
- Thực hiện các công việc liên quan đến ký mới, gia hạn, thanh lý Hợp đồng lao động, giải quyết chế độ cho CBNV nghỉ việc;
- Theo dõi thực hiện và giải quyết các chính sách phúc lợi, các chế độ BHXH cho CBNV (báo tăng, giảm, đối chiếu hàng tháng, các thủ tục về chế độ liên quan tới NLĐ); - Tham gia xây dựng bảng lương và đánh giá thực hiện công việc của Công ty theo định kỳ;
- Chịu trách nhiệm xử lý, hướng dẫn và giải đáp thắc mắc về các chế độ và chính sách cho CBNV trong Công ty

- Thực hiện công tác tính tiền lương và các chế độ tiền lương cho CBNV: tiền lương, phụ cấp, thưởng/thưởng kinh doanh, ... - Thực hiện các công việc liên quan đến Thuế TNCN: giảm trừ gia cảnh, khấu trừ thuế TNCN hàng tháng, quyết toán thuế TNCN hàng năm;
- Thực hiện các công việc liên quan đến ký mới, gia hạn, thanh lý Hợp đồng lao động, giải quyết chế độ cho CBNV nghỉ việc;
- Theo dõi thực hiện và giải quyết các chính sách phúc lợi, các chế độ BHXH cho CBNV (báo tăng, giảm, đối chiếu hàng tháng, các thủ tục về chế độ liên quan tới NLĐ); - Tham gia xây dựng bảng lương và đánh giá thực hiện công việc của Công ty theo định kỳ;
- Chịu trách nhiệm xử lý quan hệ lao động, hướng dẫn và giải đáp thắc mắc về các chế độ và chính sách cho CBNV trong Công ty
- Lưu trữ và theo dõi hồ sơ của toàn nhân sự trong Công ty (Ngày vào Công ty, vị trí công việc, loại HĐLĐ, mức lương, phụ cấp, điều chuyển công tác, khen thưởng, kỷ luật,...).

- Thực hiện theo dõi chấm công, thực hiện nội quy của nhân viên trong công ty;
- Thực hiện công tác tính tiền lương và các chế độ tiền lương cho CBNV: tiền lương, phụ cấp, thưởng/thưởng kinh doanh, ... - Thực hiện các công việc liên quan đến Thuế TNCN: giảm trừ gia cảnh, khấu trừ thuế TNCN hàng tháng, quyết toán thuế TNCN hàng năm;
- Quản lý công văn đi - đến;
- Cập nhật thông tin nhân sự, lưu trữ hợp đồng lao động, hồ sơ nhân viên
- Quản lý, mua sắm tài sản, trang thiết bị, công cụ dụng cụ văn phòng
- Theo dõi và giải quyết chế độ BHXH, BHYT cho người lao động toàn công ty
- Phối hợp tổ chức các sự kiện nội bộ và xây dựng văn hóa của công ty
- Quản lý nhân sự
- Thực hiện công tác tuyển dụng nhân sự theo yêu cầu: đăng tuyển, sàng lọc hồ sơ, lên lịch phỏng vấn, thông báo kết quả cho ứng viên.
